import React from 'react'
import '../Internal.css'
import { QuoteItems } from './QuoteItems'

export const QuoteOne = () => {
    return (
        <div className='quote-box'>
            <p className='quote-p'>
                {QuoteItems[0].quote}
            </p>
            <p className='quote-author'>
                {QuoteItems[0].author}
            </p>
        </div>
    )
}

export const QuoteTwo = () => {
    return (
